import React,{useEffect,useState} from 'react'
import {LinkContainer} from 'react-router-bootstrap'
import swal from 'sweetalert'
import { Table,Button,Row } from 'react-bootstrap'
import Loader from "../components/Loader"
import Message from "../components/Message"
import { useDispatch,useSelector } from 'react-redux'
import { useNavigate } from "react-router-dom"
import { listProducts } from '../components/actions/productAction'


export default function ProductListPage() {
    const dispatch = useDispatch()
    const navigate = useNavigate()

    const productList = useSelector(state =>state.productList)
    const {loading,error,user} = productList

    const userLogin = useSelector(state =>state.userLogin)
    const {userInfo} = userLogin

    



    useEffect(()=>{
        if(userInfo && userInfo.isAdmin){
            
            dispatch(listProducts())
        }else{
            navigate('/login')
        }

    },[dispatch,navigate,successDelete,userInfo])

    const deleteHandler =(id) =>{
        //pop up
        swal({
            title: "Are you sure want to delete?",
            text: "You will not able to recover this user", 
            icon: "warning",
            buttons: true,
            dangerMode: true,
        })
        .then((willDelete) => {
          if (willDelete) {
            swal("Poof! user has been successfully deleted!", {
              icon: "success",
            });
            //dispatch(deleteUsers(id))
            //window.location.reload(false);
          } else {
            swal("User is safe!");
         } })
        }
    const createProductHandler=(product) =>{

    }

  return (
    <div>
        <Row className='align-items-center'>
            <Col><h2>Products</h2></Col>
            <Col className='text-right'></Col>
            <Button className='my-3' onClick={createProductHandler}><i className='fas fa-plus'></i>Create Product</Button>
        </Row>
        <h2>Product List</h2> 
        {loading ?( <Loader/> ):error ?( <Message variant='danger'>{error}</Message>)

        :(
            <Table striped bordered hover responsive className='table-sm'>
                <thead>
                    <tr>
                    <th>ID</th>
                    <th>NAME</th>
                    <th>PRICE</th>
                    <th>CATEGORY</th>
                    <th>BRAND</th>
                    <th></th>
                    </tr>
                    
                </thead>

                <tbody>
                    {products.map(product=>(
                        <tr key={product._id}>
                        <td>{product._id}</td>
                        <td>{product.name}</td>
                        <td>{product.price}</td>
                        <td>{product.category}</td>
                        <td>{product.brand}</td>
                       

                        <td>
                            <LinkContainer to={`/admin/product/${product._id}/edit`}>
                                <Button variant='light' className='btn-sm'>
                                    <i className='fas fa-edit'></i>
                                    </Button>
                            </LinkContainer>
                            {""}
                            <Button variant='danger'
                            onClick={()=> deleteHandler(product._id)}
                            className='btn-sm mx-2'>
                                    <i className='fas fa-trash'></i>
                                    </Button>
                        </td>
                        </tr>
                    ))}
                </tbody>

            </Table>
        )}
    </div>
  )
}
